    return(
        <Fragment>
            <div>Login</div>

            <label>Username</label>
            <input type="text" id="txtUsername" placeholder="Enter Username" /><br></br>
            
            <label>Password</label>
            <input type="password" id="Password" placeholder="Enter Password" /><br></br>

            <button >Save</button>
        </Fragment>
    )

}

export default Login
